import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monster1: {
        name: "Frankenstein",
      },
      monster2: {
        name: "Hulk",
      },
      monster3: {
        name: "Freaky",
      },
    };
  }

  render() {
    return <div className="App">
      <h1>{}</h1>
    </div>;
  }
}

export default App;
